We can override the values of any scalar variables by specifying them as input variables. To do this, we add a line at the top of the code to specify that these are input variables: in = [k]
k { 1.0 }
u { 0.1 }
F { k * u } Here we have specified a single input parameter k that is used in the RHS function F. The value of k is set to 1.0 in the code, but this value is only a default, and can be overridden by passing in a value at solve time. We can use input parameters anywhere in the code, including in the definition of other input parameters. in = [k]
k { 1.0 }
g { 2 * k }
F { g * u } or in the intial conditions of the state variables: in = [k]
k { 1.0 }
u_i { x = k,
}
F { u }

