We can also specify the outputs of the system. These might be the state variables themselves, or they might be other variables that are calculated from the state variables. Here is an example where we simply output the elements of the state vector: u_i { x = 1.0, y = 2.0, z = 3.0,
}
out_i { x, y, z } or we can derive additional outputs from the state variables: u_i { x = 1.0, y = 2.0, z = 3.0,
}
out { x + y + z }

