Each element of a tensor can optionally be given a name or label that can be used to refer to the element in expressions. For example, to define a vector with two named elements: v_i { x = 1.0, y = 2.0,
} Here we have defined a single tensor v_i with two named elements x and y. We can then refer to the individual elements in expressions, where they will act as if they were separate variables: v_i { x = 1.0, y = 2.0 }
w_i { 2 * y, 3 * x }

