We can use standard algebraic operations on variables. To refer to previously defined variables, we use the variable name, making sure to use the correct subscript if it is a vector or tensor. For example, to define a scalar variable \( a \) as the sum of two other scalar variables \( b \) and \( c \), we write: b { 1.0 }
c { 2.0 }
a { b + c } The scalar a will therefore be equal to 3.0. To define a vector variable \( \mathbf{v} \) as the sum of two other vector variables \( \mathbf{u} \) and \( \mathbf{w} \), we write: u_i { 1.0, 2.0 }
w_i { 3.0, 4.0 }
v_i { u_i + w_i } Notice that the index of the vectors within the expression must match the index of the output vector v_i. So if we defined v_a instead of v_i, the expression would be: v_a { u_a + w_a }

