Broadcasting is supported in the language, so you can perform element-wise operations on tensors of different shapes. For example, the following will define a new vector \( \mathbf{d} \) that is the sum of \( \mathbf{a} \) and a scalar \( k \): a_i { 1.0, 2.0 }
k { 3.0 }
d_i { a_i + k } Here the scalar \( k \) is broadcast to the same shape as \( \mathbf{a} \) before the addition. The output vector \( \mathbf{d} \) will be \( [4.0, 5.0] \). DiffSL uses the same broadcasting rules as NumPy, and you can read more about this in the NumPy documentation .
